import React from 'react'
import './Header.css'

export const Header = () => {
  return (
    <div>
    <nav class="navbar navbar-expand-lg bg-body-tertiary">
        <div class="container-md">
        <a class="navbar-brand" href="#">Navbar</a>
        </div>
        </nav>
    </div>
  )
}
